function ExpenseItem() {
    return(
        <div>
            <div className="expense-item">Date</div>
            <div className="expense-item__description">
                <h2>Car Insurance</h2>
                <div className="expense-item__price">Rs44</div>
            </div>
        </div>
    );
}
export default ExpenseItem;
